import React, { useState } from 'react';

export const [page, setPage] = useState(0);

const Pagination = () => {
    const nextPage = () => {
        setPage(page + 1);
    }

    const prevPage = () => {
        if (page > 0) {
            setPage(page - 1);
        }
    }
    return (
        <div className='pagination'>
            <button onClick={prevPage}>Previous</button>
            <button onClick={nextPage}>Next</button>
            <h4>page : {page + 1}</h4>
        </div>
    );
};

export default page = page;
